import React from 'react';
import './index.css';
import { useHistory } from "react-router-dom";
import { AiFillCloseCircle } from "react-icons/ai";

function ModalPost(){
  const history = useHistory();

  return(
    <div className="modal-post-container">
      <div className="modal-post-container">
        <AiFillCloseCircle />
      </div>
    </div>
  )
}

export default ModalPost;
